window.bookSummaryJSON = "<p>Insurance can be confusing and expensive, but it's also necessary protection from risk. To alleviate that confusion, Tony Steuer has created a comprehensive guide to insurance--from how to calculate your ideal level of coverage to avoiding fraud--using the familiar metaphor of professional football. Your agents act as your coaching team, and each type of insurance is a player on your team, covering a different position.</p>"; 
